import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function AlumniSignup({ onLoginClick, onSignupSubmit }) {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        password: '',
        mobile: '',
        isWorking: false,
    });
    const navigate = useNavigate();

    const handleChange = (e) => {
        const { name, value, type, checked } = e.target;
        setFormData({
            ...formData,
            [name]: type === 'checkbox' ? checked : value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Submit form logic
        onSignupSubmit();
        navigate('/');
    };

    return (
        <div style={{ textAlign: 'center', padding: '2rem' }}>
            <h2>Alumni Signup</h2>
            <form onSubmit={handleSubmit}>
                <input type="text" name="name" placeholder="Name" value={formData.name} onChange={handleChange} required />
                <input type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange} required />
                <input type="password" name="password" placeholder="Password" value={formData.password} onChange={handleChange} required />
                <input type="tel" name="mobile" placeholder="Mobile Number" value={formData.mobile} onChange={handleChange} required />
                <div>
                    <label>Are you currently working in any place?</label>
                    <input type="checkbox" name="isWorking" checked={formData.isWorking} onChange={handleChange} />
                </div>
                <button type="submit" style={{ padding: '0.5rem 1rem' }}>Submit</button>
            </form>
            <p>Already have an account? <span onClick={onLoginClick} style={{ color: 'blue', cursor: 'pointer' }}>Login</span></p>
        </div>
    );
}

export default AlumniSignup;
